import React from 'react';
import "./topbar.scss";
export default function TopBar() {
  return (
    <div className="topbar" id="topbar">
      <div className="wrapper">
        <div className="left">
           <a href="#intro">adad</a>
        </div>
         <div className="right">
           <h1>Hello</h1>
        </div>

        <div><h1>Smecher</h1></div>
       
      </div>
    </div>
  )
}
